import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../components/common/header';
import { createClient } from '@supabase/supabase-js';

// Initialize Supabase client
const supabaseUrl = 'https://klligruouvwvqrwrxqcj.supabase.co';
const supabaseAnonKey = 'your-anon-key'; // Replace with your actual Supabase anon key
const supabase = createClient(supabaseUrl, supabaseAnonKey);

async function getUserInfo() {
    const user = supabase.auth.user();
    if (!user) return { error: { message: 'No user logged in' } };

    const { data, error } = await supabase
        .from('profiles')
        .select('first_name, last_name, location, employee')
        .eq('id', user.id)
        .single();
    return { data, error };
}

const ProfilePage = () => {
    const [firstName, setFirstName] = useState('');
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchProfile = async () => {
            const { data, error } = await getUserInfo();
            if (error) {
                setError(error.message);
                setLoading(false);
                navigate('/login');
            } else if (data) {
                setFirstName(data.first_name); // Assuming your column name is 'first_name'
                setLoading(false);
            }
        };

        fetchProfile();
    }, [navigate]);

    if (loading) {
        return <div>Loading...</div>;
    }

    return (
        <div className="min-h-screen flex flex-col bg-black">
            <Header />
            <div className="flex-grow container mx-auto p-4 text-center">
                <h1 className="text-white font-extrabold text-4xl md:text-6xl lg:text-7xl tracking-tight mt-3">Profile</h1>
                {error && <p className="text-red-500">{error}</p>}
                <div className="mt-10">
                    <p className="text-white font-bold text-xl md:text-3xl">Welcome, {firstName}</p>
                </div>
            </div>
            <footer className="bg-gray-200 text-center p-4">
                Â© 2024 Bruh (bRUH), Inc.
            </footer>
        </div>
    );
};

export default ProfilePage;
